  padding: 0 40px 0 36px;
  position: relative;
  color: ${colors.foregroundPrimary};
  > svg {
    position: absolute;
    top: 0;
    left: 0;
    width: 28px;
    height: 28px;
  }
`;

export const IconTag2 = styled.div`
  font-weight: 400;
  font-size: 18px;
  line-height: 28px;
  opacity: 0.8;
  padding: 0 40px 0 36px;
